&lt;p&gt;&lt;a href="http://www.flickr.com/people/80651083@N00/"&gt;bridgepix&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/80651083@N00/4700038939/" title="Storm Clouds at Sunset"&gt;&lt;img src="http://farm2.static.flickr.com/1270/4700038939_f4bcd77b7c_m.jpg" width="240" height="161" alt="Storm Clouds at Sunset" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;Looking downriver from the top of Lower Falls, storm clouds move in to block the setting sun at the &lt;b&gt;Monroe Street Bridge&lt;/b&gt; in Spokane, Washington.&lt;br /&gt;
&lt;br /&gt;
The Lower Falls cascade down and kick up spray at the base of the bridge.&lt;br /&gt;
&lt;br /&gt;
&lt;a href="http://en.wikipedia.org/wiki/Monroe_Street_Bridge" rel="nofollow"&gt;Monroe Street Bridge&lt;/a&gt; is a deck arch bridge that spans the Spokane River in Spokane, Washington. The bridge was the largest concrete-arch bridge in the United States at the time it was built. It was built in 1911 by the city of Spokane and was designed by John Chester Ralston and Kirtland Kelsey Cutter. At the time of completion it was the largest concrete-arch bridge in the United States and the third longest in the world.&lt;br /&gt;
&lt;br /&gt;
The current bridge is actually the third bridge in this location. The first bridge, a rather rickety wooden structure, was built in 1889. The bridge was first closed due to arguments in the city over rites of passage and ownership. It then burned down in 1890 and then replaced with a steel bridge. The second bridge vibrated badly and had a noticeable dip in the center. A consultant from the Good Roads Movement considered the bridge unsafe in 1905. The design of the third bridge was largely copied from the Rocky River Bridge in Cleveland, Ohio, but was built one foot longer to make it the largest concrete arch in the United States at the time. The bridge was designed with ornamental features such as bison skulls, covered pavilions, and a chain-link railing motif. The bison skull was an inspiration of Patrick C. Shine who found it in Drumheller, Alberta, Canada, in the early 1900s.&lt;br /&gt;
&lt;br /&gt;
The bridge underwent changes in 1925 and in 1934, and submitted to the modernization of Spokane. The pavilion lamps were changed to electric lighting in ’25 and the electric car railways were removed from the bridge in ‘34. The bridge was listed on the National Register of Historic Places in 1975. By the 1990s, the current bridge had deteriorated to the point where rebuilding it was necessary. In January 2003, the bridge was closed for restoration, dismantled down to the central arch, and rebuilt faithfully to the original appearance. The bridge was reopened in 2005 and continues to provide excellent views of Spokane Falls. (Wikipedia)&lt;/p&gt;

