&lt;p&gt;&lt;a href="http://www.flickr.com/photos/carsonm/4703573406/" title=""&gt;&lt;img src="http://farm5.static.flickr.com/4050/4703573406_9a64fa8ac6_m.jpg" width="159" height="240" alt="" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;Last night I took the family and we wandered around Manito Park while Dad bossed everyone around a bit with the camera. They were all fairly tolerant and indulged me. The weather was wonderful, the light was lovely and we capped it all off with ice cream. Hard to beat that.&lt;br /&gt;
&lt;br /&gt;
I experimented some with shooting into the sun. I like how the flare worked on this one. It hurt the contrast a little, but I found the tones and overall feel of it pleasing. &lt;br /&gt;
&lt;br /&gt;
 I'll be posting more from this excursion as I process them.&lt;/p&gt;

