&lt;p&gt;&lt;a href="http://www.flickr.com/people/mwahlsten/"&gt;mwahlsten&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/mwahlsten/4717707812/" title="Spokane from the Train"&gt;&lt;img src="http://farm5.static.flickr.com/4013/4717707812_2b9c5d5684_m.jpg" width="240" height="160" alt="Spokane from the Train" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;The skyline of Spokane, Washington as seen from the windows of Amtrak's &lt;i&gt;Empire Builder&lt;/i&gt;. &lt;br /&gt;
&lt;br /&gt;
This is an important and lengthy stop for the train. Heading west, the train is split up into two sections - one bound for Seattle and one bound for Portland. Heading east, the opposite happens and the two sections are combined into one.&lt;/p&gt;

