&lt;p&gt;The eastbound Portland section of Amtrak's &lt;i&gt;Empire Builder&lt;/i&gt; arrives into downtown Spokane, Washington at about midnight on a Friday evening. The train will remain in Spokane for about an hour a half, after which time it will continue heading east with section from Seattle attached.&lt;/p&gt;

