&lt;p&gt;My DSLR is not the top-of-the-line and and I was really upset when I transfered the set to my desktop and saw the noise... I forgot tho change the ISO off 800 from the previous shoot.  The Canon EOS 300D goes to 1600 but that setting is totally unusable.  I usually shoot at ISO 100 or 200 to keep the noise down...  To combat my noise problem I added some gradients to the sky and landscape with Photo Shop.  Oh, and the definition in the moon came from a composite captured a little later in the shoot (using f/32 and bulb for shutter control).&lt;/p&gt;

