&lt;p&gt;This &lt;b&gt;Radio Flyer&lt;/b&gt; &lt;a href="http://spokaneriverfrontpark.com/index.php/RFP/page/367/" rel="nofollow"&gt;Red Wagon&lt;/a&gt; is an interactive sculpture at &lt;b&gt;Riverfront Park&lt;/b&gt; in Spokane Washington. Made of reinforced concrete, this 12 foot high wagon is a &lt;b&gt;playground slide&lt;/b&gt;. Children climb the steps on the rear and slide down the handle. Created for the Centennial Celebration of Children in 1989 - artist is Ken Spiering, titled &amp;quot;The Childhood Express&amp;quot;.&lt;br /&gt;
