&lt;a href="http://en.wikipedia.org/wiki/Riverfront_Park_(Spokane,_Washington)" rel="nofollow"&gt;Riverfront Park&lt;/a&gt; is a public park in downtown Spokane, Washington. The 100 acre park is located along the Spokane River, not far up from the Spokane Falls. It was created for Expo '74, a World's Fair event. The defining feature of the park is the Pavilion, which is marked by a 145-foot-tall (44 m) metal frame and wire shell that formed the US Pavilion tent during Expo '74. The park is well known for the Riverfront Park Carousel, as well as an IMAX theatre, Clock tower, skyride over the falls, a small amusement park for kids, a skating rink during the winter months, and the Spokane River Centennial Trail which passes through it. (Wikipedia)&lt;/p&gt;

