&lt;a href="http://en.wikipedia.org/wiki/Spokane_Falls" rel="nofollow"&gt;Spokane Falls&lt;/a&gt; is the name of the series of waterfalls and dams on the Spokane River in downtown Spokane, Washington.&lt;br /&gt;
