The falls consists of an Upper Falls and a Lower Falls. The Upper Falls is the site of the Upper Falls Dam, a diversion dam constructed in 1920 that directs the water into the Upper Falls intake on the south channel of the Spokane River. (Wikipedia)&lt;/p&gt;

