&lt;p&gt;&lt;a href="http://www.flickr.com/photos/80651083@N00/4752263202/" title="Riverfront Rotary Fountain, Riverfront Park, Spokane, Washington"&gt;&lt;img src="http://farm5.static.flickr.com/4139/4752263202_fe183cfd84_m.jpg" width="240" height="161" alt="Riverfront Rotary Fountain, Riverfront Park, Spokane, Washington" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;The &lt;a href="http://spokaneriverfrontpark.com/index.php/RFP/page/366/" rel="nofollow"&gt;Riverfront Park Rotary Fountain&lt;/a&gt; is located on Howard Street at the South entrance to Riverfront Park. It is a popular attraction for beating the Summer heat. The kids love it!&lt;br /&gt;
&lt;br /&gt;
Dedicated on September 1st, 2005 to “the people of Spokane” and under the care of the Spokane Parks Department, the fountain is destined to be a popular attraction for many years to come. The Downtown Spokane Rotary Club 21 and the Spokane Parks Department worked together to make the fountain a reality. Financial support was also provided by numerous donors whose names appear around the fountain. Harold Balazs is the artist.&lt;br /&gt;
&lt;br /&gt;
The fountain has 5 stainless steel columns that are 24 feet tall. These support a 30 foot diameter ring containing 40 overhead jets. The jets spray towards the middle of the fountain producing a dome of water and a waterfall in the fountain’s center. Eight geysers shoot water upwards. The fountain also has dozens of mist jets, and the 5 boulders have jets that spray sideways. To conserve water, the fountain water is filtered and recirculated.&lt;br /&gt;
&lt;br /&gt;
You can catch the fountain in action from Spring to Fall, 6am to midnight.&lt;br /&gt;
&lt;br /&gt;
&lt;a href="http://en.wikipedia.org/wiki/Riverfront_Park_(Spokane,_Washington)" rel="nofollow"&gt;Riverfront Park&lt;/a&gt; is a public park in downtown Spokane, Washington. The 100 acre park is located along the Spokane River, not far up from the Spokane Falls. It was created for Expo '74, a World's Fair event. The defining feature of the park is the Pavilion, which is marked by a 145-foot-tall (44 m) metal frame and wire shell that formed the US Pavilion tent during Expo '74. The park is well known for the Riverfront Park Carousel, as well as an IMAX theatre, Clock tower, skyride over the falls, a small amusement park for kids, a skating rink during the winter months, and the Spokane River Centennial Trail which passes through it. (Wikipedia)&lt;/p&gt;

