&lt;p&gt;I went up to Manito Park (everything was finally in bloom!) yesterday with my boyfriend. I'm so deliriously happy. We've known each other three years and been together four-ish months. He's from Germany (we met when he was an exchange student at my high school) and his family has a lake cabin not far from me so he comes here every summer and we're together as long as he's State-side. He's been nuts about me since he met me and I've finally come to my senses and fallen hopelessly in love with him. I don't know what I did to deserve such a wonderful, beautiful, brilliant man, but I'm lucky and blessed to call him my own! For this picture, he grabbed my camera for a shot and I used my iPhone. I love this boy. He's into just about everything I am (science, photography, soccer, literature, music, etc.) and to put a cherry on top...he's gorgeous. :) I especially love it when he starts talking in German. :)&lt;/p&gt;

