&lt;p&gt;This is a friend from high school's new golden retriever puppy. He's twelve weeks old, a bundle of energy, and waaaaay too cute to be real. I got to dogsit him for a few hours two weekends ago. There is something so theraputic about playing with cute puppies. :)&lt;/p&gt;

