&lt;p&gt;Only at Gonzaga will you find a license plate that says leadership with the Administration building as the background and Spike (our bulldog mascot) on it. There is something uniquely different about Gonzaga, it's graduates, and the people it influences. Wherever you travel, you'll always meet a GU grad (whether they graduated ten years ago or forty years ago) and they will always have a story for you, always be able to connect with you no matter how different you may be, and always extend a hand of friendship (and sometimes a job offer!). I love my campus and the people here. :)&lt;/p&gt;

