&lt;p&gt;&lt;a href="http://www.flickr.com/photos/tbiytc/4786484685/" title="365.185 : Farmer's Market"&gt;&lt;img src="http://farm5.static.flickr.com/4075/4786484685_f47b2f1393_m.jpg" width="240" height="181" alt="365.185 : Farmer's Market" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;On Thursday afternoon Carla and I went to the Farmer's Market on the South Hill. I haven't been to one since I was a kid living in Oregon. They had the most amazing food and whatnot there! I bought fresh cherries (crisp), fresh baked rosemary bread (scrumptuous), and fixings to make salad (fresh). Heaven.&lt;br /&gt;
&lt;br /&gt;
I apologize for not doing my 365 the last four days. I spent the weekend from Thursday afternoon to Sunday night at my boyfriend's cabin on Priest Lake. I had zero cell reception or Internet connection. I'll be uploading the pictures tonight.&lt;br /&gt;
&lt;br /&gt;
The weekend was a blast. My boyfriend, his sister, and two of our friends built a campfire, lit fireworks (well, the boys did, his sister and I avoided nearly killing ourselves), cooked, watched great comedies, danced, and goofed off in general.&lt;br /&gt;
&lt;br /&gt;
After spending four days with the man I love, it's hard to suddenly not see him. He'll be in town on Thursday and I get to see him this weekend again. All I want to do today is cry because I'm not in his arms anymore and before I left yesterday we had a very long, hard discussion about what's going to happen to our relationship when he moves back to Germany in three weeks. He's going to take some time to think about it and we're going to pick up the conversation on Thursday. I'm just shaking at the thought of losing him. Yikes. A few days of solitude and work will be good to clear my head though.&lt;/p&gt;

