&lt;p&gt;&lt;a href="http://www.flickr.com/people/jjakober/"&gt;) Jason (&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/jjakober/4791626006/" title="Bowl &amp;amp; Pitcher"&gt;&lt;img src="http://farm5.static.flickr.com/4096/4791626006_239b2dd9ba_m.jpg" width="180" height="240" alt="Bowl &amp;amp; Pitcher" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;The Bowl and Pitcher is the most popular scenic attraction for many visitors to Riverside State Park. It is a geologic phenomenon resulting in spectacular scenery. Large basaltic knobs sit like oversized lumps of sugar along the edges of the Spokane River.&lt;br /&gt;
&lt;br /&gt;
To make the area even more special, a swinging bridge crosses the Spokane River at the Bowl and Pitcher. Built by the Civilian Conservation Corps in the late 1930's, the suspension bridge is a prime attraction for visitors to the Bowl and Pitcher area of Riverside State Park. The foot-traffic-only bridge is fairly accessible for all, with a paved trail leading from the parking lot down to the bridge and the river. A small kitchen shelter with tables is on the west side of the bridge, as well as miles of trails leading north and south along the river.&lt;/p&gt;

