&lt;p&gt;Two weeks ago, my boyfriend stayed the night with me while my housemates were in town. He was concerned about my safety around a bunch of party animals (knowing that someone cares about you like that is refreshing). We went through h-e-double-hockey-sticks that night. He crashed on the couch in my room and neither of us could sleep. My housemates partied and did everything they could to keep us awake until four in the morning. We woke up at 7:30 and left by 8:15. This was taken at Starbucks a few minutes later as we were drinking coffee and waking up. Bless his heart, he was cheerful and calm instead of cranky and miserable like most people would be. We spent the day at a friend's house playing Xbox and watching movies (we were avoiding going back to my place). Thank God I am not living with these guys this year or ever again for that matter. Yikes.&lt;/p&gt;

