&lt;p&gt;Yesterday morning, the registrar and tennis coach at my high school passed away suddenly and unexpectedly. She was only 51. She was an amazing woman and loved the students of Gonzaga Prep very much. My boyfriend's sister had been extremely close to her this year and the news of her passing really hit close to home. I took the day off work and the three of us drove out to their extended family's log cabin about a half hour from Spokane. We talked, ate delicious food, and let my boyfriend's sister and the extended family grieve together. This shot is from the drive up to their house.&lt;/p&gt;

