&lt;p&gt;&lt;a href="http://www.flickr.com/people/tbiytc/"&gt;stark.rockets&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/tbiytc/4991126308/" title="365.249 : Metal, You Have Met Your Match!"&gt;&lt;img src="http://farm5.static.flickr.com/4085/4991126308_96ef1e0798_m.jpg" width="182" height="240" alt="365.249 : Metal, You Have Met Your Match!" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;On Friday (my second day of learning how to weld), my boss taught me how to weld shut holes using MIG welding (MIG: Metal Inert Gas). He had me weld shut one of the smaller ends of the pipes. Welding holes shut is tricky because you have to do so from the edges and inside-out basically. The goal is to do the welding as flat as possible. Part of the trickiness of welding a hole shut is to fire the torch for a few seconds and then wait a few seconds for the metal to cool before firing again. If you don't wait and fire too soon, you'll just burn an even bigger hole in the metal.&lt;br /&gt;
&lt;br /&gt;
My boss, after seeing I had successfully (except for a few uneven bumps) welded shut two ends of the smaller pipes, told me to weld the largest one shut (center of picture). I had to leave work in twenty minutes to meet up with the suitemates for a Friday full of shopping (Insanely successful $400 later....What? I had gotten paid that day and had earned a LOT more than I thought I originally had!), pizza, and a movie night (best Friday night of college since I left Seattle last winter). My two co-workers just laughed and said, &amp;quot;There's no way you're going to finish on time!&amp;quot; When you weld, the size of the metal you fire each time is the size of a sharpie tip. That's how small of a molten piece of metal you're dealing with. So you can imagine how long it would take to weld shut the entire large pipe. I had to leave work at 3:00. Guess who finished at 2:59 p.m.? :D My co-workers were shocked that I finished on time and had welded the entire thing completely flat. I kid you not. I love me job. :)&lt;/p&gt;

