&lt;p&gt;My suitemates and I stopped to pick up a pizza on the way back to the dorm from shopping on Friday night. We went to a pizza place up on the South Hill about two blocks from Manito Park (for other pictures from Manito Park, check out my albums called Ash @ Manito and Adventures With Justus). The Duncan Gardens (formal British gardens) were all in bloom (finally!). The Rose Garden was also in bloom. The suite has decided that next weekend we're going to dress up in dresses, heels, the works and go to Manito and do suite pictures. I'm so excited to take those pictures! :) The suite of guys next door to us heard about our plans and asked if they could get in on it. They're going to dress up as well and we're going to do brother-sister suite pictures. After the pictures, we're thinking we're all going to go downtown to the Olive Garden for dinner. Next weekend is going to be a blast!&lt;/p&gt;

