&lt;p&gt;My mom adopted a four year-old rescued Malamut named Kiarra. She's super skittish and has abandonment issues, but she's so, so, SO adorable! When she perks up and isn't scared silly, she's the dorkiest dog ever. She and I bonded pretty quickly when I met her three weeks ago. I go home one afternoon a week to walk her and hang out with her now. She finally has a good home to be a part of. Welcome to the family, Kiarra. :)&lt;/p&gt;

